document.addEventListener("alpine:init",(()=>{Alpine.data("managerFrm",(()=>({dates:["Carregando..."],date:"",data:[],loading:!1,buttonLabel:"Enviar",initStart:!0,configInit(){document.querySelector("#date").addEventListener("change",(t=>{this.loadData("")})),this.initStart?this.loadData("init"):this.loadData("")},loadData(t){this.loading=!0,vdate="",this.data=[],"init"!=t&&(this.initStart=!1,vdate=document.getElementById("date").value.split("/").reverse().join("-")),fetch(document.getElementById("route_list").value+"?date="+vdate).then((t=>t.json())).then((t=>{if(1==this.initStart){let e=[];t.dates.forEach((t=>{e.push(t.split("-").reverse().join("/"))})),this.dates=e}this.foodTable(t.data)})).finally((()=>{this.loading=!1}))},foodTable(t){let e=document.getElementById("log-result");e.innerHTML="",t.forEach((t=>{let a=`row-table-${t.status.toLowerCase()}`;e.insertRow().innerHTML=`\n                            <td class="${a}">${t.source}</td>\n                            <td class="${a}">${t.type}</td>\n                            <td class="${a}">${t.file}</td>\n                            <td class="${a}">${t.description}</td>\n                            <td class="${a}">${t.created_at}</td>\n                            `}))}})))}));
